// UserFollowers.js
import React from 'react';
import { List, ListItem, ListItemText, Button, Avatar } from '@mui/material';

const UserFollowers = ({ followers, onLoadMore }) => (
  <>
    <List>
      {followers.map((follower, index) => (
        <ListItem key={index} button component="a" href={follower.html_url} target="_blank">
          <Avatar src={follower.avatar_url} />
          <ListItemText primary={follower.login} />
        </ListItem>
      ))}
    </List>
    <Button variant="contained" color="primary" onClick={onLoadMore}>
      Load More
    </Button>
  </>
);

export default UserFollowers;
